import React from 'react'
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { white } from '@mui/material/colors';

const theme = createTheme({
  palette: {
    primary: {
        main: '#ff79c6',
    },
  },
});

const whiteTextFieldStyle = {
    backgroundColor: '#ffffff', // Hintergrundfarbe auf Weiß setzen
  };
  
  const whiteTextStyle = {
    color: '#ffffff', // Textfarbe auf Weiß setzen
  };
  

export default function InputAndReturn() {
  return (
 
    <>
    <form>
    <ThemeProvider theme={theme}>
    <TextField id="outlined-basic" label="Outlined" variant="outlined" InputProps={{
              input: whiteTextStyle, // Textfarbe auf Weiß setzen
            }}/>
      <Button variant="contained">+</Button>
    </ThemeProvider>
    </form>
    </>

  )
}
